const RobotInfo = () => {

    return (
        <div style={{ 
        display: 'flex', justifyContent: 'center', alignItems: 'center', 
        width: '100%', height: '100vh'
        }}>

        <h1>로봇 정보 화면입니다</h1>        

        <Link to="/Login">로그인 화면으로</Link>        
      </div>

    );
};

export default RobotInfo;
